// solar
// pulse
// cyborg
import Head from 'next/head'

// images
import beerPunk from '../img/beerPunk.png'
import blog from '../img/blog.png'
import chuckNorris from '../img/chuckNorris.png'
import movieSearch from '../img/movieSearch.png'
import tempConverter from '../img/tempConverter.png'
import weatherSearch from '../img/weatherSearch.png'

const projects = [
  {
    name: 'Beer Punk',
    img: beerPunk,
    desc: 'Fetch and filter beers from the Beer Punk API',
    url: 'https://beerpunk.vercel.app/'
  },
  {
    name: 'Blog',
    img: blog,
    desc: 'Create, edit and delete blog posts to a MongoDB database',
    url: 'https://primblog.vercel.app/'
  },
  {
    name: 'Chuck Norris Facts',
    img: chuckNorris,
    desc: 'Chuck Norris fact generator',
    url: 'https://chucknorrisfacts.vercel.app/'
  },
  {
    name: 'Movie Search',
    img: movieSearch,
    desc: 'Search movies and television shows',
    url: 'https://moviesearch.vercel.app/'
  },
  {
    name: 'Temperature Unit Converter',
    img: tempConverter,
    desc: 'Convert temperature to given unit of measurement',
    url: 'https://tempconverter.vercel.app/'
  },
  {
    name: 'Weather Search',
    img: weatherSearch,
    desc: 'Search weather by city and state',
    url: 'https://weather-search.vercel.app/'
  }

]

import Navbar from '../components/Navbar'

const Index = () => {

  return (
    <div>
      <Head>
        <link rel="stylesheet" href="https://bootswatch.com/4/pulse/bootstrap.min.css" />
      </Head>
      <Navbar />
      <div
        className="container"
        style={{
          marginTop: '25px'
        }}
      >
        <h1>Travis Williams.</h1>
        <br />
        <div className="row">
          {
            projects.map((project, idx) => {
              return (
                <div key={idx} className="card col-sm-4" >
                  <img className="card-img-top" src={project.img} alt="Card image cap" />
                  <div className="card-body">
                    <h5 className="card-title">{project.name}</h5>
                    <p className="card-text">{project.desc}</p>
                    <a href={project.url} className="btn btn-primary">View App</a>
                  </div>
                </div>
              )
            })
          }
        </div>
      </div>
    </div>
  )
}

export default Index
